import React from 'react';
import PropTypes from 'prop-types';

const AppLayout = ({children}) => {
  return (
    <div>
      <div>공통메뉴</div>
      {children}
    </div>
  )
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired, //자식 요소할때 node이다. 
};

export default AppLayout;
